requests.description:
`POST /api/v1/measures`

#### Request Header
key | value
--- | ---
Content-Type | application/json

#### Request Body

name | description | type
--- | --- | --- 
measure | measure entity | Measure

There are two different measures that are griffin measure and external measure.
If you want to create an external measure,you can use following example json in request body.
```
{
    "measure.type": "external",
    "name": "external_name",
    "description": " test measure",
    "organization": "orgName",
    "owner": "test",
    "metricName": "metricName"
}
```
Postman gives a griffin measure example in request body and response body. 
#### Response
The response body should be the measure created if success. For example:
```
{
    "measure.type": "griffin",
    "id": 1,
    "name": "measureName",
    "description": "measure description",
    "organization": "orgName",
    "owner": "test",
    "deleted": false,
    "dq.type": "accuracy",
    "process.type": "batch",
    "data.sources": [
        {
            "id": 1,
            "name": "source",
            "connectors": [
                {
                    "id": 1,
                    "name": "connector_name_source",
                    "type": "HIVE",
                    "version": "1.2",
                    "predicates": [
                        {
                            "id": 1,
                            "type": "file.exist",
                            "config": {
                                "root.path": "hdfs:///griffin/demo_src",
                                "path": "/dt=#YYYYMMdd#/hour=#HH#/_DONE"
                            }
                        }
                    ],
                    "data.unit": "1h",
                    "config": {
                        "database": "default",
                        "table.name": "demo_src",
                        "where": "dt=#YYYYMMdd# AND hour=#HH#"
                    }
                }
            ]
        },
        {
            "id": 2,
            "name": "target",
            "connectors": [
                {
                    "id": 2,
                    "name": "connector_name_target",
                    "type": "HIVE",
                    "version": "1.2",
                    "predicates": [
                        {
                            "id": 2,
                            "type": "file.exist",
                            "config": {
                                "root.path": "hdfs:///griffin/demo_src",
                                "path": "/dt=#YYYYMMdd#/hour=#HH#/_DONE"
                            }
                        }
                    ],
                    "data.unit": "1h",
                    "config": {
                        "database": "default",
                        "table.name": "demo_src",
                        "where": "dt=#YYYYMMdd# AND hour=#HH#"
                    }
                }
            ]
        }
    ],
    "evaluate.rule": {
        "id": 1,
        "rules": [
            {
                "id": 1,
                "rule": "source.desc=target.desc",
                "name": "rule_name",
                "description": "Total count",
                "dsl.type": "griffin-dsl",
                "dq.type": "accuracy",
                "details": {}
            }
        ]
    }
}
```

It may return failed messages. For example:

```
{
    "timestamp": 1517205933656,
    "status": 409,
    "error": "Conflict",
    "code": 40901,
    "message": "Measure name already exists",
    "path": "/api/v1/measures"
}
```
There will be 'status' and 'error' fields in response if error happens, which correspond to HTTP status, and there may also be 'code' and 'message' fields, which will point out the cause. If an exception happens at server, there will be an 'exception' field, which is the name of exception.

